import React from 'react'
import {useFormik} from 'formik'
import axios from 'axios'
import {store} from '../App';
import {useContext} from 'react'

const Createuser = () => {
  const URL="http://localhost:8080";
  const data = useContext(store);
  console.log(data);
  const formik=useFormik({
    initialValues:{
      mothername:"",
      fathername:"",
      location:"",
      designation:"",
      city:"",
      age:""
    },
    onSubmit:(values)=>{
      try{
        axios.post(`${URL}/createUser`,values).then((res)=>{
          alert("User created successfully")
        })
      }catch(err){
        console.log(err)
      }
    }
  });

  return (
    <div className='container'>
      <form onSubmit={formik.handleSubmit}>
        <div style={{display:'flex',flexDirection:'column',justifyContent:'start',alignItems:'flex-start'}}>
          <label htmlFor='mothername'>Mothername</label>
          <input onChange={formik.handleChange} type="text" id='mothername' name="mothername" value={formik.values.mothername} className='form-control' placeholder='Enter Mothername'/>
          <label htmlFor='fathername'>Fathername</label>
          <input onChange={formik.handleChange} type="text" id='fathername' name="fathername" value={formik.values.fathername} className='form-control' placeholder='Enter Fathername'/>
          <label htmlFor='location'>Location</label>
          <input onChange={formik.handleChange} type="text" id='location' name="location" value={formik.values.location} className='form-control' placeholder='Enter Location'/>
        </div>
        <div style={{display:'flex',flexDirection:'column',justifyContent:'start',alignItems:'flex-start'}}>
          <label htmlFor='designation'>Designation</label>
          <input onChange={formik.handleChange} type="text" id='designation' name="designation" value={formik.values.designation} className='form-control' placeholder='Enter Designation'/>
          <label htmlFor='city'>City</label>
          <input onChange={formik.handleChange} type="text" id='city' name="city" value={formik.values.city} className='form-control' placeholder='Enter City'/>
          <label htmlFor='age'>Age</label>
          <input onChange={formik.handleChange} type="text" id='age' name="age" value={formik.values.age} className='form-control' placeholder='Enter Age'/>
        </div>
        <div className='text-center m-3' >
          <button type='submit' className='btn btn-danger'>Submit</button>
        </div>
      </form>
    </div>
  )
}

export default Createuser
